import React from "react";
import { styled } from "@mui/material/styles";
import { Box, Container, Grid, List } from "@mui/material";

const Hoe = styled("div")(({ theme }) => ({
  fontSize: "70px",
  [theme.breakpoints.down("sm")]: {
    fontSize: "20px",
  },
}));

const Voe = styled("div")(({ theme }) => ({
  fontSize: "70px",
  [theme.breakpoints.down("sm")]: {
    fontSize: "20px",
  },
}));

function Home() {
  return (
    <div>
      <Box
        sx={{
          height: "199px",
          maxWidth: "100%",
          backgroundColor: "red",
        }}
      ></Box>
    </div>
  );
}

export default Home;
